import React, { Component } from 'react'
import styled from 'styled-components'
const HomeImage = styled.div`
    width: 100%;
    height: 100%;
    background-image: url('../assets/images/main.jpg')
`
class Home extends Component {
  render() {
    return (
     <HomeImage>

         </HomeImage>
    )
  }
}
export default Home
